//pages/Nav.js
import React from "react";
import './eventFestival.css';
function eventFestival() {
  return (

    <div className = "eventFestivalInFunction">
        <p id = "sharpquote">#지금 강원도에서는</p>
        <p id = "hgc">- 행사 . 공연 . 축제 -</p>

        <div id = "conDiv">
          <div id = "con1"></div>
          <div id = "con2"></div>
          <div id = "con3"></div>
        </div>
        
        <div id = "polygon"></div>
    </div>
  );
}

export default eventFestival;
